/* eslint-disable jest/no-conditional-expect */

function createBuilderSpec(transformType, builder, expected) {
  return ["should build properties for \"".concat(transformType, "\""), function () {
    switch (transformType) {
      case 'default':
        {
          var defaultModel = builder.build();
          expect(defaultModel).toEqual(expected);
          break;
        }
      case 'rest':
        {
          var _defaultModel = builder.buildRest();
          expect(_defaultModel).toEqual(expected);
          break;
        }
      case 'graphql':
        {
          var _defaultModel2 = builder.buildGraphql();
          expect(_defaultModel2).toEqual(expected);
          break;
        }
      default:
        throw new Error("Unknown transform type ".concat(transformType, "."));
    }
  }];
}

export { createBuilderSpec };
